import React, { useState } from 'react';
import Form from '../Form'
import './Climb.css';


const Climb = ({climbList}) => {
    const[values, setValues] = useState({
        gym: null,
        climbType: null,
        grade: '',
        rating: null,
    });



    return climbList.map((climb, index) => (
        <div
          className='climb-item'
          key={index}
        >
          <div key={climb.id} >
            {climb.gym}
          </div>

        </div>

      ));
};

export default Climb;
